"use strict";function onStart(){populateCookieValues()}function populateCookieValues(){const address=Cookies.get("address");const port=Cookies.get("port");const plexToken=Cookies.get("plex_token");if(address){$("#address").val(address)}if(port){$("#port").val(port)}if(plexToken){$("#plex_token").val(plexToken)}}function back(){location.assign("index.html")}function next(){Cookies.set("address",$("#address").val());Cookies.set("port",$("#port").val());Cookies.set("plex_token",$("#plex_token").val());location.assign("plexLibraries.html")}